@HausborgDR @tuffswamp @LIGAdrp3 Slet ikke din fejl, Morten.

Bare super ærgerligt at DR insisterer på at Danmarks bedste sports-radioprogram skal ledsages af musik som (postulat) størstedelen af programmets målgruppe ikke bryder sig om.

Du skal bare fortsætte med det, du gør - for det gør du godt!
